import React from 'react';
import ReactDOM from 'react-dom';
import './styles.css';
import Formulario from './Formulario';

ReactDOM.render(
	<React.StrictMode>
		<div className="container">
            
			<Formulario />
		</div>
	</React.StrictMode>,
	document.getElementById('root')
);
